Y integer default NULL,  NAME varchar2(255) default NULL,  DESCRIPTION clob,  EXTENDED_DESCRIPTION clob,  JOB_VERSION varchar2(255) default NULL,  JOB_STATUS integer default NULL,  ID_DATABASE_LOG integer default NULL,  TABLE_NAME_LOG varchar2(255) default NULL,  CREATED_USER varchar2(255) default NULL,  CREATED_DATE date default NULL,  MODIFIED_USER varchar2(255) default NULL,  MODIFIED_DATE date default NULL,  USE_BATCH_ID char(1) default NULL,  PASS_BATCH_ID char(1) default NULL,  USE_LOGFIELD char(1) default NULL,  SHARED_FILE varchar2(255) default NULL,  PRIMARY KEY  (ID_JOB));CREATE TABLE T_EXPORT_MONITOR (  MONITOR_ID integer NOT NULL,  CONFIG_ID integer default NULL,  STARTTIME date default NULL,  EXPORT_COUNT number(20) default NULL,  EXPORT_BITE_SIZE number(20) default NULL,  END_TIME date default NULL,  STATUS varchar2(10) default NULL,  DATA_PATH varchar2(255) default NULL,  PRIMARY KEY  (MONITOR_ID));CREATE TABLE T_INCREMENT_INFO (  INCREMENT_ID integer NOT NULL,  CONFIG_ID integer default NULL,  "ROWNUM" varchar2(10) default NULL,  LAST_DATE date default NULL,  PRIMARY KEY  (INCREMENT_ID));CREATE TABLE T_INTERFACE_USER (  USER_ID integer NOT NULL ,  USERNAME varchar2(20) default NULL,  PASSWORD varchar2(100) default NULL,  SYSTEM_NAME varchar2(50) default NULL,  SYSTEM_IP varchar2(50) default NULL,  SYSTEM_DESC varchar2(400) default NULL,  PRIMARY KEY  (USER_ID));CREATE TABLE T_JOB_LOG (  JOB_ID integer NOT NULL ,  JOB_CONFIG_ID integer default NULL /*对应r_job表中的ID_JOB主键*/,  CHANNEL_ID varchar2(255) default NULL /*唯一，通UUID表示\r\n*/,  JOB_NAME varchar2(255) default NULL,  JOB_CN_NAME varchar2(255) default NULL,  STATUS varchar2(50) default NULL,  LINES_READ number(20) default NULL,  LINES_WRITTEN number(20) default NULL,  LINES_UPDATED number(20) default NULL,  LINES_INPUT number(20) default NULL,  LINES_OUTPUT number(20) default NULL,  LINES_REJECTED number(20) default NULL,  ERRORS number(20) default NULL,  STARTDATE date default NULL,  ENDDATE date default NULL,  LOGDATE date default NULL,  DEPDATE date default NULL,  REPLAYDATE date default NULL,  LOG_FIELD clob,  EXECUTING_SERVER varchar2(255) default NULL,  EXECUTING_USER varchar2(255) default NULL,  EXCUTOR_TYPE number(4) default NULL /*1:表示本地，2表示远程，3表示集群*/,  JOB_LOG clob,  PRIMARY KEY  (JOB_ID));CREATE TABLE T_JOB_STEP_LOG (  JOB_STEP_ID integer NOT NULL,  JOB_ID integer default NULL,  CHANNEL_ID varchar2(50) NOT NULL,  LOG_DATE date default NULL,  JOBNAME varchar2(100) default NULL /*父JOB的名称*/,  STEPNAME varchar2(100) default NULL,  LINES_READ number(20) default NULL,  LINES_WRITTEN number(20) default NULL,  LINES_UPDATED number(20) default NULL,  LINES_INPUT number(20) default NULL,  LINES_OUTPUT number(20) default NULL,  LINES_REJECTED number(20) default NULL,  ERRORS number(20) default NULL,  RESULT number(20) default NULL,  NR_RESULT_ROWS number(4) default NULL,  NR_RESULT_FILES number(20) default NULL,  LOG_FIELD number(20) default NULL /*日志字段为这个特定的工作条目包含错误日志日志LOG_FIELD*/,  COPY_NR number(20) default NULL,  SETP_LOG clob,  PRIMARY KEY  (JOB_STEP_ID));CREATE TABLE T_QUARTZ_TASK (  TASK_ID integer NOT NULL,  TASK_CN_NAME varchar2(255) NOT NULL,  TRIGGER_NAME varchar2(255) NOT NULL,  TASK_TYPE integer NOT NULL,  TASK_CONFIG_ID varchar2(255) NOT NULL,  TASK_NAME varchar2(255) NOT NULL,  TASK_SLAVE_SERVER varchar2(255) default NULL,  TASK_PARAMS varchar2(500) default NULL,  RUNTYPE integer default NULL,  FTPPATH varchar2(255) default NULL,  SCHEDULETYPE integer default NULL,  PRIMARY KEY  (TASK_ID));CREATE TABLE T_SERVICE_AUTH (  AUTH_ID integer NOT NULL,  USER_ID integer default NULL,  SERVICE_ID integer default NULL,  AUTH_IP varchar2(50) default NULL,  USE_DESC varchar2(200) default NULL,  USE_DEPT varchar2(50) default NULL,  USER_NAME varchar2(50) default NULL,  PRIMARY KEY  (AUTH_ID));CREATE TABLE T_SERVICE_INTERFACE ( 